import React from "react";

class Projects extends React.Component {
    render() {
        return(<List.Item
        actions={[
          <DatePicker
            format="MM/DD/YYYY"
            onChange={this.handleDateChange}
            value={this.props.todo.date}
          />,
          <Icon
            type="close-circle"
            theme="filled"
          />
        ]}
      >
        {this.props.todo.content}
      </List.Item>
        );
    }
}

export default Projects;
